(1, '2023-10-12', 'Daniel Gluhak', 'Director Peter Sohn Reflects on the Global Success of Pixars Elemental – Exclusive Interview', 'When it comes to the world of animated storytelling and filmmaking, Peter Sohn is a legend in his own right and of his own making.', 'Elemental may only be his second directorial feature, but Sohn has been a staple of Pixar Animation Studios since the early 2000s. While attending the prestigious CalArts, Sohn worked on major animated projects like The Iron Giant and Osmosis Jones. It was not until after graduating from CalArts that Sohn found himself at Pixar during the production of Finding Nemo. He is been at Pixar ever since, serving as an animator, story and production artist, writer, director, producer, and more over the past two decades. This also includes voice acting, with Emile in Ratatouille, Squishy in Monsters University, and Sox in Lightyear being Sohns most beloved voice roles.\r\n\r\nPeter Sohn made his true directorial debut with the short Partly Cloudy, which played before screenings of Up in 2009. A few years later, when director Bob Peterson stepped down from The Good Dinosaur, Sohn was brought in to fulfill the role of director and complete the movie. So while Elemental may technically only be his sophomore effort with the studio, Sohn has clearly put in the needed time to tackle Pixars latest feature film with the right confidence and experience. Elemental takes place in Element City, a metropolitan society where anthropomorphic elements – fire, water, earth, and air – coexist as long as they play by the rules of nature. However, after an unexpected meeting, fire element Ember Lumen (Leah Lewis) and water element Wade Ripple (Mamoudou Athie) learn that opposites attract and that norms are sometimes meant to be broken.\r\n\r\nElemental is Pixars first romantic comedy, focusing on Ember and Wade as they explore the complexities of their newfound romance. But there is more to this fire meets water story than meets the eye. We see that Ember and her familys origins as fire elements in Element City touch upon themes of immigration, which further complicates her relationship with Wade as two elements with different physical properties that are also from different cultural backgrounds. This piece of the film closely reflects Peter Sohns own life as the son of Korean immigrants who made a new life for themselves in New York. The Korean-American filmmaker originally did not think he would include so much of his familys story when making Elemental, yet it felt like the right path to take given how so much of this movie is meant to honor the sacrifices that parents make for their kids.\r\n\r\nThe films messaging has resonated deeply with audiences around the globe. After opening to a lackluster box office weekend in June, many were ready to dismiss Elemental as just another Disney flop. Yet, it proved to have considerable legs in the months that followed. Positive word-of-mouth steadily carried the animated rom-com to considerable financial and critical success. Elemental has now gone on to match box office records set by the original Toy Story, becoming the first original animated film to earn over $400 million in theaters since 2017 (before the COVID-19 pandemic). Much of its gains have come from international audiences, most notably from South Korea. Elemental is not only the most-viewed foreign film of the year there but also the most-viewed Pixar film in the countrys history. According to the Walt Disney Company, one out of every eight people in Korea have seen Elemental – a stunning feat.', 'Elemental.jpg', 1),
(2, '2023-10-13', 'Ivan Horvat', 'The Positive Impact of Taylor Swifts Eras Tour Film in Theaters', 'She is a singer, songwriter, director, philanthropist, and a decorated musician with 10 studio albums and 12 Grammy wins to date.', 'Taylor Swift is arguably one of the most influential artists of the 21st century, and the worlds massive legion of Swifties will always remind you of that. Her latest ongoing string of concerts across the globe, dubbed The Eras Tour, is on track to possibly become the highest-grossing tour of all time. So, it is no wonder that Taylor Swift: The Eras Tour – a concert film made for theatrical release – has already surpassed $100 million at the global box office in presales alone. Swift has long proved herself as a powerful force in the music industry, with a career spanning 17 years and counting. But with the Eras Tour movie, she is now setting herself up as a force to be reckoned with at the cinema.\r\n\r\n<h3>A Swift Lesson</h3>\r\n\r\nWith Taylor Swift: The Eras Tour expected to break box office records, the question is not about if but how large of an impact Swift is making on the film industry. That is a bit of a heavy-loaded question, so lets trace things back to see how the Eras Tour movie is creating a huge moment for the theatrical experience. Taylor Swifts music career started in 2006 and she is since released 10 studio albums, making up a discography of over 200 songs of which she has written or co-written every single one. Her journey as an artist ca not be defined by any single genre, as she migrated from her original roots in Country music over to Pop as well as dabbling in Indie, Alternative, and Folk over the years.\r\n\r\nNo matter the category her music might fall under at any given time, though, her talent and prowess as a writer, vocalist, and musician are always apparent. Sure, Swift knows how to write a lighthearted and peppy hit radio single, but when diving deeper into her songs, a quick examination would prove her lyricism to be as moving as classic poetry – so eloquent that fun Taylor Swift or Shakespeare? quizzes are rampant online and across social media. However, things shifted in 2019 when entrepreneur/music executive Scooter Braun obtained the master recordings of Swifts first six studio albums as part of his purchase of her previous label, Big Machine Records. Swift left Big Machine in 2018 to sign with Republic Records and Universal Music Group, and despite some efforts, she was not able to purchase back her original masters, claiming that the record label only offered unfavorable conditions.\r\n\r\nAfter claims of Brauns controlling and less-than-cooperative nature made headlines, Swift announced that she was going to rerecord every single one of her previous albums in order to reclaim full authorship of her work, as she has been a vocal advocate in the belief that artists should be able to legally own their art. So far, Swift has rerecorded and released Fearless (Taylors Version), RED (Taylors Version), and Speak Now (Taylors Version) with 1989 (Taylors Version) set to drop on October 27th and Reputation (Taylors Version) next up on the horizon. With Swift traveling back into her entire catalog, it was only a matter of time before this lauded reclamation took the shape of a global tour. ', 'Taylor-Swift.jpg', 2),
(3, '2023-10-27', 'Ivan Horvat', 'The Insidious Franchise Ranked Worst to Best', 'In 2011, a mysterious marketing campaign kicked off and caught many young impressionable minds.', 'In 2011, a mysterious marketing campaign kicked off and caught many young impressionable minds. A series of surreal, startling images, recalling that of a haunted house film but with a little bit of an extra bite flashed across the screen, with the tagline Insidious Is Insidious. What the hell did that mean? Little did many of us know… the birth of a new beloved horror franchise. Coming off their successful collaborations on the Saw franchise, director James Wann and writer Leigh Whannell were ready to take a gamble on a new concept: a PG-13 horror film about a boy with the ability of astral projection who ends up captured by a cruel demon in a place far away from his physical body. This place, known as The Further, is a spiritual realm where malevolent forces dwell, consumed by fog.\r\n\r\nWith a budget of just over a million and the backing of producers Jason Blum and Oren Peli, who were then riding the highs of their Paranormal Activity franchise, no one knew what was to come. But, against all odds, 2011s Insidious was a cultural phenomenon that lit up the box office, making nearly 100 times its budget. It helped launch Blumhouse Productions into the big leagues and made James Wan a highly in-demand director. Furthermore, Insidious became one of the horror genre most reliable moneymakers. This proved true until the very end. The franchise final chapter, Insidious: The Red Door, was released in theaters over the summer and now stands as the highest-grossing horror movie of 2023 at the worldwide box office. Given this noteworthy achievement, it is time to take a look back at the Insidious franchise as a whole for a ranking.\r\n\r\nOnce you go through all five Insidious films, it becomes clear just how high quality the series is altogether. There is no obvious low point in the bunch, which is rare for any horror franchise. That being said, how do they stack up against each other? Lets find out by ranking each entry of the Insidious franchise from worst to best.\r\n\r\n<h2>All 5 Films in the Insidious Franchise Ranked Worst to Best</h2>\r\n\r\n<h3>5. Insidious: The Red Door </h3>\r\n<b>\r\nDirected by Patrick Wilson\r\nScreenplay by Scott Teems\r\nStory by Scott Teems & Leigh Whannell\r\nReleased on July 7, 2023\r\n</b>\r\n\r\nThere’s not a whole lot wrong with Insidious: The Red Door. It’s a slightly above-average entry in the ever-growing canon of “elevated horror” examining trauma, this time behind the memory-repressed Josh Lambert (Patrick Wilson) and his son Dalton (Ty Simpkins), who’s now a teenager moving into college. Patrick Wilson, in his directorial debut, captures tenderness with a moderate eye for scares – a scene where Josh is in an MRI machine occupied by a nefarious entity will be hell for the claustrophobic. At the end of the day, however, it’s not much of an Insidious movie at all. After waiting nearly a decade to see the Lambert family again, audiences are treated to very little of Rose Byrne’s Renai Lambert and a plotline that involves trying to remember the events of the first two movies. This keeps the audience a whole saga of information ahead of the protagonists. \r\n\r\nPitting the Lamberts up against their ultimate antagonist, the fan-favorite Lipstick-Face Demon (or “The Man With Fire In His Face”) whose return has been long anticipated by fans since the first film, should be catnip to the creatives. But screenwriter Scott Teems is wholly uninterested in using the Lipstick-Face Demon, who barely appears in the movie after all the heavy teasing, or even the metaphysical realm of The Further as anything other than fodder for Josh and Dalton learning to love one another. There’s an expectation, with this amount of build-up of Josh remembering his past, for a grand payoff; a return to the untold horrors held in The Further. Instead, Insidious: The Red Door plays more like an epilogue to the original two films stretched out to feature length. And in that regard, it’s unsatisfying to the supernatural aspect the franchise has made its bread and butter.', 'Insidious.jpg', 2);

