(1, '2023-08-22', 'Daniel Gluhak', 'Ahsoka', 'Dave Filoni Promises the Next Disney+ Hit', 'The first two episodes of Ahsoka on Disney+ prove that the translation from animation to live-action might be worth some excitement.', 'It is safe to say Star Wars television is in a rather fascinating position at the moment. The Mandalorian Season 3 proved to be the most divisive season yet, where many fans were turned away by the execution of the Bo-Katan Mandalore arc. On the other side, Andor was just nominated for 8 Emmys, including Best Drama Series, which is a major milestone for Lucasfilm. Obi-Wan Kenobi managed to secure an Emmy nomination in the Best Limited Series category too, despite the backlash that show got mainly due to some of its lackluster visuals and direction that brought down its overall potential greatness.\r\n\r\nNevertheless, pending the SAG-AFTRA and WGA strikes ending with fair deals for both actors and writers, the future of Star Wars television looks bright. From Star Wars animation continuing to thrive with The Bad Batch entering its third and final season to live-action storytelling looking set to have a huge 2024 outside of the Mandoverse with The Acolyte from showrunner Lesley Headland (Russian Doll) and Andor Season 2 from Tony Gilroy. Still coming from the Mandoverse in the foreseeable future is Star Wars: Skeleton Crew from Spider-Man: No Way Home director Jon Watts and, of course, Ahsoka which is being overseen by none other than writer-director Dave Filoni.\r\n\r\nAhsoka on Disney+ continues the titular characters story from her live-action debut in The Mandalorian Season 2 as well as following her tale with Sabine teased in the epilogue of the animated series Star Wars Rebels. Audiences tag along with the former Jedi Knight Ahsoka Tano as she investigates an emerging threat, Grand Admiral Thrawn (Lars Mikkelsen), to a vulnerable galaxy. The live-action show picks up various plot threads left hanging for over five years from the series finale of Rebels, including Ezra Bridger and Thrawns disappearances and Sabine and Ahsoka setting out from a newly established Lothal to find them.\r\n\r\nThe big question about Ahsoka is whether or not new viewers will need to have watched Star Wars Rebels beforehand in order to understand this Disney+ original series. As someone who has ranked Rebels as their favorite Star Wars series for years, it is difficult to definitively say whether someone with no knowledge of these characters will still have enjoyment watching Ahsoka. Coming out of the first 2 episodes, showrunner Dave Filoni does an adequate job of re-establishing all of the main and supporting cast within this corner of the Star Wars universe, providing brief refreshers for returning fans and newbies alike.\r\n\r\nHowever, certain references to Ezra, Thrawn, and other minor callbacks to Rebels will surely fly over the heads of some new people watching or make them confused. Whether this show succeeds without prior knowledge of what came before depends on what sort of television viewer you are. As much as a full watch of Star Wars Rebels is recommended, new audiences can be pretty much invested without that or by just watching a simple recap video – something that is not ideal for the future of television.\r\n\r\nA major point of contention with Ahsoka is the translation from animation to live-action where many fans have wished that Dave Filoni and Jon Favreau kept this project to the medium that it was started in. Admittedly, settling into these live-action character interpretations takes a minute. What really helps solidify this live-action translation as a success is Natasha Liu Bordizzo as Sabine Wren. Bordizzos performance is revelatory for this series and easily its biggest strength. Not only does she embody what Tiya Sircar made brilliant about the Mandalorian warrior in Star Wars Rebels, but Filonis writing also allows Bordizzo to bring her own dimensions to Sabine.\r\n\r\nSabine Wren almost feels like a fully fleshed-out new person from how we last saw her five years ago. There is a clear unseen backstory established between Sabine and Ahsoka that helps to establish theorization of what has happened during this time gap as well as what we will discover within the incoming plot. Natasha Liu Bordizzo will leave you wanting more of her interpretation of Sabine, making the character a fresh fan-favorite for some and a further beloved icon for others.\r\n\r\nMeanwhile, main star Rosario Dawson has not yet reached her full potential as Ahsoka Tano. Even though her performance has improved since her last live-action appearance in The Book of Boba Fett, Dawson still has not been given the right emotional beats for Ahsoka that made fans root for her animated counterpart. Signs begin to pop up within the second episode that Dawson clearly understands the intricacies of Ahsoka from her younger self seen in The Clone Wars. Still, it may just be getting used to an older interpretation of this Jedi Knight who no longer has all this hope around the galaxy. Rosario Dawson has delivered a satisfactory performance so far but elements introduced before the second episode closes provide hints that she is about to bring even more energy to the role that will be familiar to the Ahsoka people first fell in love with.\r\n\r\nThe final three major translations into live-action are Mary Elizabeth Winstead as Hera Syndulla, David Tennant as Huyang, and Chopper. Winsteads performance takes a little bit to get used to at first, but once she embodies Heras attitude as a General and you see her bantering with Chopper on The Phantom, she effortlessly falls into the role. Just like Sabine Wren, Ahsoka on Disney+ honors what Vanessa Marshall had set up with the revolutionary leader previously while bringing on board a Hera with more authority and responsibility. Hera still acts as a mother to her found family though, especially towards Natasha Liu Bordizzos Sabine. Interactions between the two feel earned and heartfelt, recalling their history in Star Wars Rebels alongside their shared losses.\r\n\r\nAs for Chopper, he is ripped from animation to live-action with ease with all humor still intact. David Tennant reprises his role of Huyang that he first started in Star Wars: The Clone Wars just under a decade ago. Where he only got a few episodes to begin this characters story in that series, Tennant gets to have a lot more fun with Huyang in Ahsoka. Dave Filoni creates a much-welcomed dimension of levity from Huyang that makes the ancient droid professor all the more lovable and hilarious.\r\n\r\nNew antagonists introduced in these first 2 episodes of Ahsoka include Baylan Skoll (the late Ray Stevenson), Shin Haiti (Ivanna Sakhno), and Marrok (whose actor is currently unknown). Skoll and Haiti are the villains that really get to shine and not only are they immediately proved to be very formidable foes for this series, but their origins are also set up with interesting kinks that tease a fascinating narrative behind their motivations as well as brilliant contrasts from Ahsoka and Sabine. Ray Stevenson and Ivanna Sakhno get their individual moments to take the spotlight, both bringing menacing performances. It will be very exciting to see the pair as they are coupled together more as master and apprentice going forward.\r\n\r\nAhsoka is mostly a success on the visual front. Where major criticisms have been levied about the middling use of The Volume for recent Star Wars ventures, including Obi-Wan Kenobi, Dave Filoni and his fellow directing team (Steph Green helms the second episode) do a splendid job so far of bringing Ahsoka to life with its own stylistic flair differentiated from The Mandalorian. While the visual quality never hits the heights of Andor, the series always looks best on Lothal, a perfect recreation of what we saw in the Star Wars Rebels finale put into live-action. The cinematography of Ahsoka especially stands out in these scenes and leads to some of the best visual work we have seen from the Volume so far.\r\n\r\nThe first 2 episodes of Ahsoka on Disney+ are quite exciting. It is obviously enjoyable to finally be able to catch up with familiar faces such as Sabine and Hera, but their live-action interpretations add new splendid dimensions that will keep audiences rooting for them for more time to come. Although many Disney+ original shows tend to deviate in quality as they progress, Dave Filoni has shown to be one to break that cycle, using the first 2 episodes of Ahsoka to perfectly set up intrigue and excitement in a fascinating tale that will leave fans clamoring each week for a new episode. This is a very promising start and it seems Ahsoka is on the right track to be the next beloved hit in Dave Filonis arsenal.', 'Tv', 4, 'Ahsoka.jpg', 1),
(2, '2023-08-31', 'Daniel Gluhak', 'One Piece', 'Netflix Finally Breaks the Anime ', 'Netflixs live-action One Piece series lives up to the manga spirit, making it one of the few great modern anime adaptations.', 'Netflixs One Piece. Before, there was a world where you would have been scoffed at for thinking such a project had a chance of being good. It is fantastical. It is ambitious. It is One Piece, one of Shonen Jumps best-selling titles that has been ongoing for nearly 30 years. Not to mention the fact that Hollywood has been trying to adapt manga and anime for decades and has not been very successful with its attempts. Sure, there have been a few good exceptions (Doug Limans Edge of Tomorrow, an adaptation of Yoshitoshi Abes All You Need Is Kill comes to mind) but the majority of these Western outgoings have been abysmal. However, after Netflixs One Piece… perhaps anime fans will no longer flinch when they are told their favorite series is getting a live-action adaptation. Fear not, this is not a repeat of what happened with Cowboy Bebop and Death Note.\r\n\r\nEiichiro Odas One Piece tells the story of Monkey D. Luffy, a pirate from the East Blue who is setting sail in search of the famed treasure of One Piece. Along the way, he finds like-minded comrades and together they form the Straw Hat Pirates and face off against other crews. The manga is, no exaggeration, one of the most beloved titles of the medium. Selling over 500 million copies worldwide and having over 1000 chapters published, there can be no denying that One Piece is a cultural phenomenon. Showrunners Matt Owens and Steven Maeda were always going to have to live up to the impossible expectations of millions of fans around the globe, which is perhaps why this series is as wonderfully realized as it is. Netflixs One Piece is clearly made by people who understand and enjoy the source material. Even though it should not be, that is rare.\r\n\r\nThis first season is brought together by directors Marc Jobst, Emma Sullivan, Tim Southam, and Josef Wladyka, each getting to helm two episodes for the streaming service. There are many things that this Netflix adaptation pulls off successfully: the thrilling action choreography, the vibrant costuming, and the vast set designs (the Going Merry, Miss Love Duck, and Baratie ships deserve praise), to name a few. However, the shows greatest strength is its cast. If you have read One Piece or even just have a vague idea of what it is, then you know that the characters are lively, not just in their designs but in how they are written. Each having personalities and mannerisms so unique that trying to find actors who could fit the role seemed like a tall order. Even Oda himself has stated that he thought it would be difficult to find someone who could fully embody Luffy.\r\n\r\nThis makes Mexican actor Iñaki Godoy a rare find indeed because he is easily one of the best casting decisions recently made by Netflix. No one else could have embodied Luffys optimistic, simple, and humorous nature. It feels like he is been literally ripped from the page and put on screen. Godoy is not the only great casting either, the Straw Hat Pirates are brought to life spectacularly by Mackenyu Maeda as the sword-wielding Roronoa Zoro, Emily Rudd as Nami the navigator, Jacob Romero Gibson as the sharpshooter Usopp, and Taz Skylar as Sanji the cook. All five actors make their characters feel so alive in such wonderfully unexpected ways. It is surreal to watch certain scenes and think That is Luffy! or That is exactly what Zoro would do! It is through the casts rich chemistry that it becomes clear that this Netflix original series is truly something special.\r\n\r\nIn terms of adaptation, Netflixs One Piece does not adhere to the mangas story page for page. Instead, the series smartly chooses to present the story in a way that is both conducive to the live-action medium it is being told in, and appealing to new and old fans alike. It keeps the core character moments from the manga, as well as key story beats, but presents them in a new way. Sometimes the order of events may be slightly tweaked, so characters might meet earlier or later than they did in the manga. Events are also often condensed and edited down in a way that fits what is trying to be accomplished in this first 8- episode season, and possibly later seasons for that matter. Everything that is changed in the One Piece live-action adaptation is done so within the spirit of the manga.\r\n\r\nWhile the tone and important character traits carry over well from the source material, what about the visuals? After all, One Piece may be a manga that is at its core about friendship, adventure, and the pursuit of personal freedom, but it is also a series that features some very flashy and sometimes emotionally heavy action sequences. Moments that, while fully visualized in the manga, may be more difficult to pull off in live-action. So how does Netflixs One Piece fair? Well, there is definitely room for improvement, to say the least. Some of the visuals and VFX work can sometimes look suspicious and poorly rendered, though, this is often offset by how fun and ambitious the directing in these scenes can be. Presentation is everything, and how Netflixs One Piece presents itself and its more fantastical elements makes it easy to forgive the flaws – what few there are.\r\n\r\nNetflixs One Piece live-action series is just a great watch. The live-action series perfectly captures the humor and heart of Odas manga. Whether you are familiar with the original manga or not, there is something here for everyone to enjoy – a charismatic cast, a great adventure on the high seas, and a memorable, visually distinct group of misfits that is easy to become invested in. Beyond all that, this could really be a watershed moment for live-action anime adaptations. Will Hollywood, or streamers to be more exact, learn the right lesson? Who would have guessed that if you put a team of passionate creatives behind a project and give them time and resources, the final product could actually turn out spectacularly? Or will they once again see a success and come away with the wrong idea? Time will tell, but let us hope for the former.', 'Tv', 4, 'OnePiece.jpg', 1),
(3, '2023-10-03', 'Ivan Horvat', 'Loki', 'Season 2 Marvels Best Series Continues to Exceed Expectations', 'Loki Season 2 avoids all the traps of the weaker Marvel shows and sets a new high bar for MCU storytelling on Disney+.', 'Marvel Studios original series lineup for Disney+ has been a mixed bag in these last two years. Some shows have faded away with hardly any lasting impact on both audiences and the Marvel Cinematic Universe at large, while others have earned acclaimed status in what is already a grandiose franchise. Loki was a project that was always destined for success with Tom Hiddleston reprising the titular, fan-favorite villain. The God of Mischiefs character arc has evolved arguably more than any other Marvel character over the years, from first being the MCUs main villain to now attempting to be its very savior in Loki Season 2. \r\n\r\nThere have been some significant changes to the creative crew of Loki since the first season came to a close in 2021. Eric Martin, who was a staff writer on season one, has taken over head writer responsibilities from Doctor Strange in the Multiverse of Madness writer Michael Waldron. In the directing department, Kate Herron passes the baton to a slew of directors this time around, including Dan Deleeuw, Kasra Farahani, and directing duo Justin Benson and Aaron Moorhead. Aside from previously directing episodes of Moon Knight, Benson and Moorhead are best known for their indie filmmaking endeavors in the horror genre with beloved gems like Something in the Dirt, The Endless, and Synchronic under their belt.\r\n\r\nMeanwhile, Loki Season 2 directors Dan Deleeuw and Kasra Farahani were previously heads of the Visual Effects and Production Design departments, respectively, on the first season. These two names are true Marvel alumni with Farahani working on titles as early as Thor and Deleeuw since Iron Man 3, but has recently served as a second unit director on Eternals and Ant-Man and The Wasp: Quantumania. Impressively, the third episode of this season, one that is certain to garner attention for its sheer scale, is Farahanis first directorial credit. \r\n\r\nThe sophomore season picks up right where we left off, following on from Sylvie (Sophia Di Martino) pushing Loki through a time door and killing He Who Remains (Jonathan Majors). At first, Loki finds himself in a version of the Time Variance Authority (TVA) where no one recognizes him but is soon reunited with Mobius, who finds himself involuntarily time-slipping through the past, present, and future. In between being torn through the very fabric of time, Mobius takes Loki to Ouroboros (Ke Huy Quan), more affectionately referred to as O.B, the sole employee in the Repairs and Advancement department who is credited with writing the TVA handbook. Together they attempt to anchor Loki in the present so that they can deal with the impending threats to the TVA.\r\n\r\nHowever, there is more than simply the fate of the universe at stake in Loki Season 2. In the wake of discovering that every TVA agent is a variant who had a life on a different timeline, many hunters are struggling to come to grips with the lives they have been forced to live. Hunter B-15 (Wunmi Mosaku) passionately implores that the rapidly expanding new branches of the timeline are not pruned, while others yearn to go and try to live their past lives in peace. As they attempt to execute their plan to stabilize time itself, Loki and Mobius must also track down Sylvie, Ravona Renslayer (Gugu Mbatha-Raw), and Miss Minutes (voiced by Tara Strong), who are scattered throughout the timeline, to ensure that they do not interfere. \r\n\r\nThe second season of Loki manages to surpass all expectations and is the finest cinematic television produced by Marvel Studios thus far. Lokis continuing journey across the multiverse offers a complex tale of morality and ubiquitous chaos, with a gorgeously crafted fantasy exterior that always goes above and beyond what is imaginable. In a twisted and ironic way, Loki must play God and make decisions that will affect every living soul in existence. But even some things are out of the God of Mischiefs control.\r\n\r\nEven when the stakes are elevated and the writing is exceptionally strong, creative integrity is never sacrificed in terms of the show production value. Loki Season 2 showcases magnificent practical sets and VFX that blend together in harmony to create a new high standard for Marvel television. Examples like the retro-esque offices of the TVA and a recreation of the 1893 World Fair in Chicago each boast eye-catching costume designs that make for a complete feast for the eyes. Compared to the plethora of comic-book adaptations around right now, Loki is visually in a league of its own.\r\n\r\nEven though the show does center around its titular trickster, this latest season thrives because it avoids neglecting its dynamic ensemble cast. With a wide mix of new and returning characters, it would not be a surprise if a couple of names got pushed to the side or worse, totally forgotten about. However, every player in Loki Season 2 is given rich material to play around with. More importantly, everyone is granted their moment to play a pivotal role in this glorious jigsaw of a narrative.\r\n\r\nTom Hiddleston and Owen Wilson once again share such a playful chemistry that makes for an infatuating leading duo. A standout of the first season was the cartoonish A.I. turned TVA mascot Miss Minutes, who was seemingly harmless at first but became more eerie with each passing episode. Miss Minutes makes her return to the series a few episodes in and as a consequence of her creators being murdered, has her own subtly sinister plan to regain power. On the other hand, Ke Huy Quan is perfectly cast as the wacky genius that is Ouroboros. After making an Oscar-winning comeback in Everything Everywhere All at Once, Quan continues to surprise as a magnetic screen presence who finds no trouble in stealing the show.\r\n\r\nLike some other MCU stories, the more technical and scientific plot points can be difficult to genuinely understand at times, but if anything this season is easier to follow. Loki Season 2 is gripping, streamlined, and above all else, confident, never over-indulging itself in the ways that recent Marvel projects have to their demise (ahem Secret Invasion). Each episode is capped off by a riveting closing moment that keeps you firmly on the edge of your seat. Many fans have had high hopes for this second installment for over two years, and with much relief, Loki Season 2 exceeds with flying colors. Although having only watched the first four out of six episodes, this easily has the potential to be the best season of television for an original Marvel series on Disney+ yet.', 'Tv', 5, 'Loki.jpg', 2);

