(1, '2023-11-01', 'Daniel Gluhak', 'Disney To Assume Full Control Of Hulu For $8.61 Billion', 'After long-time speculation that Disney wants to gain full control of Hulu, the company is officially set to acquire it for $8.61 billion dollars', 'Hulu is about to be fully owned by Disney as the major Hollywood studio is officially acquiring the remaining shares of the streaming provider. The age of streaming continues to evolve as studios are constantly competing to drive more subscribers to their respective platforms. With Disney+ adding new shows and movies, it continues to be one of the more dominating platforms, while the studio has also held shares in Hulu for a number of years.\r\n\r\nHowever, it turns out Hulu will have one full owner in the foreseeable future. According to Deadline, Disney is officially set to acquire the remaining 33% stake in Hulu for $8.61 billion dollars. This brings an end to Disney and Comcasts agreement that went into effect back in 2019 and comes after Comcast CEO Brian Roberts revealed in September that he and Disney CEO Bob Iger were having discussions about a potential sale.\r\n\r\nWhile this could lead to changes in subscription plans and content libraries, the biggest question that currently stands unanswered is if Hulu will be merged into Disney+. Once Hulu is under its full control, it would not be shocking if Disney would rather have the two services be combined, as Hulu and Disney+ offer similar types of content. Unless Disney is planning on making significant changes to Hulu where it would benefit the studio in having the service exist on its own, combining it with Disney+ would be the logical choice.\r\n\r\nIt is similar to when Warner Bros. Discovery was looking at folding in HBO Max and Discovery+, with the service now operating as Max. The benefit that Disney has with merging Hulu and Disney+, compared to when Discovery+ and HBO Max were being eyed to combine, is that Hulu has more desirable content that could lead to an increase in subscribers for Disney+. For example, Hulu has titles such as Only Murders in the Building, The Bear, and Solar Opposites.\r\n\r\nIt will obviously be quite a while until Disney+ full acquisition of Hulu is completed, as it will likely go into effect in 2024. What will be interesting to follow is how Disney plans to use Hulu when it comes to the many IPs that they are in control of, such as the Marvel Cinematic Universe and Star Wars. For now, time will tell if Disney+ will merge with Hulu, or if the latter will remain as its own streaming service.\r\n\r\nSource: Deadline', 'Diney-buy.jpg', 1),
(2, '2023-11-01', 'Ivan Horvat', 'Frasier Director Admits The Harsh Truth About Kelsey Grammers Character In The Reboot', 'Frasier director James Burrows admits the harsh reality about Kelsey Grammers character, which explains his struggles in the Paramount+ reboot.', 'Director James Burrows admits the harsh truth about Kelsey Grammers character in the Frasier reboot. Frasier Cranes return to the small screen after 19 years comes with new challenges in a familiar city — Boston. Grammer is still magnificent as the snobbish but lovable therapist, who is now starting over in Beantown following a series of life changes, including the death of his dad, Martin Crane. Admittedly, getting the project off the ground was not easy for Grammer, who also produced the project. It is only in the Frasier reboot episode 4 that it is finally able to justify its existence.\r\n\r\nRegardless of what comes next for the character, it will not be that different from his old experiences. Burrows points out in a new interview with El Pais that he has not really changed. Read the directors full quote below:\r\n\r\n<em>Frasiers character remains the same, he has not evolved over the years. You do not want to rewrite the Bible, you want to make sure the character stays the same,</em>\r\n\r\n<h2>Why Frasier Needs To Finally Change In The Reboot</h2>\r\n\r\nAt his core, Frasier is actually a good person since his best asset is his eternal optimism and earnest desire to help others. His KACL job as a radiotherapist highlighted that. Soured by his experience during the last few years of Dr. Crane, Frasier seems to have developed an aversion to doling out advice, which he is excellent at. The Frasier reboot not being able to showcase Frasiers best trait, unfortunately, amplifies his long-standing flaws, proving Burrows correct about him not changing.\r\n\r\nIt is imperative that Frasier finally evolves in the revival. This is his third and likely last act, meaning there will be no more outings for the character beyond the Paramount+ project. If he wants to have a truly meaningful relationship that he has always wanted, he needs to re-evaluate himself. That also applies to his attempt to fix his relationship with his grown-up son, Freddy. For the Frasier reboot to have a satisfying finale, it needs to leave Frasier in a happy place, and that is difficult to achieve if he continues with his old patterns.\r\n\r\nThe biggest indication of his willingness to change is when Frasier reunites with his ex-wife Lilith. As someone who has seen Frasier through most of his adult life, it will be curious how their dynamic has evolved since the last time they were together on-screen. It is uncertain when Lilith will appear in the Frasier reboot, but it is arguably one of the most anticipated episodes of the show.\r\n\r\nSource: El Pais', 'frasier.jpg', 2),
(3, '2023-11-01', 'Daniel Gluhak', 'Wednesday Cosplay Nails Jenna Ortegas Look (& Includes Thing)', 'An impressive Wednesday Addams cosplay brings Jenna Ortegas macabre character to life from the hit Netflix show, and the getup even includes Thing.', 'Jenna Ortegas Wednesday comes to life in an impressive new cosplay, which even includes Thing. First airing on Netflix last year, Wednesday serves as an origin story of sorts for Wednesday Addams, the iconic Addams Family character. The show was a big hit for the streamer, with Ortegas performance garnering particular praise and birthing a series of viral trends.\r\n\r\nNow, as the wait for Wednesday season 2 news continues, lacrymastory on Instagram has shared her impressive new cosplay of Ortegas lead character. Opting to give Wednesday a latex rendition of her iconic outfit, the cosplayer even has Thing perched on her shoulder, which appears to have been pulled off with some nifty photo editing skills.\r\n\r\nSource: lacrymastory/ Instagram', 'wednesday-cosplay.jpg', 1);

